import React from "react";
import ReactDOM from "react-dom";
import { useParams, useLocation } from "react-router-dom";
import Fade from "react-reveal/Fade";

export default function Category() {
  const location = useLocation();
  const params = new URLSearchParams(location.search);
  const name = params.get("name");

  const goToHome = () => {
    props.history.push(`/category?name=home`);
  };
  const goToFashion = () => {
    props.history.push(`/category?name=fashion`);
  };
  const goToOutdoor = () => {
    props.history.push(`/category?name=outdoor`);
  };
  const goToProjects = () => {
    props.history.push(`/category?name=projects`);
  };
  const goToSouls = () => {
    props.history.push(`/category?name=souls`);
  };
  return (
    <Fade bottom cascade={true}>
      <div className="authContainer">
        <div className="form1">
          <div><h2>{name}</h2></div>
<div >
              {" "}
              <button style={{ margin: "20%", width:"80%" }} onClick={goToHome}><h3>Home</h3></button>
            </div>
            <div>
              {" "}
              <button style={{ margin: "20%", width:"80%" }} onClick={goToFashion}><h3>Fashion</h3></button>
            </div>
            <div >
              {" "}
              <button style={{ margin: "20%", width:"80%" }} onClick={goToOutdoor}><h3>Outdoor</h3></button>
            </div>
            <div>
              {" "}
              <button style={{ margin: "20%", width:"80%" }} onClick={goToProjects}><h3>Projects</h3></button>
            </div>
            <div>
              {" "}
              <button style={{ margin: "20%", width:"80%" }} onClick={goToSouls}><h3>Souls In A Box</h3></button>
            </div>
          <div className="categoryContainer">
            <div style={{ margin: "20%" }}> </div>
          </div>
        </div>
      </div>
    </Fade>
  );
}
